window.bookSummaryJSON = "<p>When you least expect it, expect it.</p> <p>Bethany Anne has been notified there is a spaceship inside the system...but they can't find it. Is it Kurtherian, someone else?</p> <p>The governments have to be told about aliens, which sparks a worldwide effort by Governments to find what TQB has....</p> <p>Oh, and Eric wants to date Gabrielle but he wants her to know he can protect her if need be. But his idea on how? Well, let's just say it might not be the best solution.</p> <p>Performed by Colleen Delany, Emily Beresford, Wyn Delano, Mark Harrietha, Tyler Hyrchuk, Jonathan Lee Taylor, Danny Gavigan, Terence Aselford, Stephanie Nemeth-Parker, Aure Nash, Evan Casey, Richard Rohan, Daniel Llaca, Michael John Casey, Michael Glenn, Sara Matsui-Colby, Bianca Bryan, Christopher Walker, Triya Leong, David Engel, Christopher Williams, James Konicek, Stephon Walker, Holly Adams, Bradley Foster Smith, Ken Jackson, Matthew Pauli, Dan Delgado, Matthew Bassett, James Lewis, Steve Wannall, Jacob Yeh, Nora Achrati, Keval Shah, Rob McFadyen, Andy Clemence, Marni Penning, Nanette Savard, Yasmin Tuazon, Zeke Alton, David Cui Cui, Nicole Perez, Tony Nam, Scott McCormick, Tia Shearer, Eva Wilhelm, Rose Elizabeth Supan, Mort Shelby, Stewart Crank, Karen Novack, and Matthew Schleigh.</p>"; 
